import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "react-bootstrap/Table";

const List = () => {
  const [reservas, setReservas] = useState({ infos: [] });

  useEffect(() => {
    const fecthReservaList = async () => {
      const { data } = await axios.get(
        "http://localhost:8000/api/v1/reservas/"
      );

      setReservas({ infos: data });
      console.log(data);
    };

    fecthReservaList();
  }, [setReservas]);

  return (
    <div>
      <Table striped bordered hover variant="dark">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Estação</th>
            <th>Periodo</th>
            <th>Data</th>
          </tr>
        </thead>
        <tbody>
          {reservas.infos &&
            reservas.infos.map((i) => (
              <tr key={i.id}>
                <td>{i.id}</td>
                <td>{i.nome}</td>
                <td>{i.estacao}</td>
                <td>{i.peiodo}</td>
                <td>{i.data}</td>
              </tr>
            ))}
        </tbody>
      </Table>
    </div>
  );
};

export default List;
